import React from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { usersType } from '../../types/Types'
import { deleteCurrentUser } from '../../Slices/currentUser'
import { Navigate, useNavigate } from 'react-router-dom'

const Profile = () => {
    const dispatch = useDispatch()
    const navigate = useNavigate()
    const exit = () => {
        dispatch(deleteCurrentUser())
        
    }
    
    const {current}: {current: usersType} = useSelector((state: any) => state.current)
  return (
    <div style={{height: "80px", display: "flex", flexDirection: "row", gap: "30px"}}>
        <h4>{current.name}</h4>
        <h4>{current.email}</h4>
        <button style={{height: "30px", width: "60px", marginTop: "15px"}} onClick={exit}>Exit</button>
    </div>
  )
}

export default Profile
